import styles from "../styles/Experience.module.css";
import { Box } from "@mui/material";

const Experience = () => {
  return (
    <div className={styles.all}>
      <div className={styles.all}>
        <h1 style={{ marginBottom: "1%" }}>Experience</h1>
        <Box className={styles.experience_box}>experience 1 in here</Box>
        <Box className={styles.experience_box}>experience 2 in here</Box>
        <Box className={styles.experience_box}>experience 3 in here</Box>
        <Box className={styles.experience_box}>experience 4 in here</Box>
      </div>
    </div>
  );
};

export { Experience };
